import styles from "./ProjectSection.module.scss";
import GoogleBooksProj from "../../styles/GoogleBooksProj.png";
import ecommerce_main from "../../styles/ecommerce_main.png";
import ecommerce_product from "../../styles/ecommerce_product.png";
import ecommerce_cart from "../../styles/ecommerce_cart.png";
import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';

export const ProjectSection = () => {
class DemoCarousel extends Component {
  render() {
      return (
          <Carousel>
              <div>
                  <img src={ecommerce_main} />
                  <p className="legend">Legend 1</p>
              </div>
              <div>
                  <img src={ecommerce_product} />
                  <p className="legend">Legend 2</p>
              </div>
              <div>
                  <img src={ecommerce_cart} />
                  <p className="legend">Legend 3</p>
              </div>
          </Carousel>
      );
  }
};

ReactDOM.render(<DemoCarousel />, document.querySelector('.demo-carousel'));
}


